import React from "react";
import {Navlink as RouterNavLink} from 'react-router';
import { Container, Row, Col, Nav, NavItem, NavLink, Navbar} from 'reactstrap';
import {Help} from '../pages/Help';
import {Settings} from '../pages/Settings';
import {User} from '../pages/User';

const TopNav = () => {
    return(
        <Navbar className="justify-content-end" bg="dark" variant="dark">
            <Nav className="justify-content-right">
                <Nav.Item>
                    <Nav.Link tag={Help} to="/help">Help</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link tag={Settings} to="/settings">Settings</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link tag={User} to="/user">User</Nav.Link>
                </Nav.Item>
            </Nav>
        </Navbar>
    )
}

export default TopNav;
